const React = require("react");

class IndexVegetables extends React.Component {
  render() {
    const { veggetables } = this.props;
    return (
      <div>
        <h1>Veggetables Index Page</h1>
        <nav>
          <a href="/fruits/newfruits">Add a New Fruit</a>
        </nav>
        <nav>
          <a href="/vegetables/newvegetables">Add a New Vegetables</a>
        </nav>
        <ul>
          {veggetables.map((vegetable, i) => {
            return (
              <li key={i}>
                The <a href={`/vegetables/${i}`}>{vegetable.name}</a> is{" "}
                {vegetable.color} <br></br>
                {vegetable.readyToEat
                  ? ` It is ready to eat`
                  : ` It is not ready to eat`}
                <br />
              </li>
            );
          })}
        </ul>
      </div>
    );
  }
}
module.exports = IndexVegetables;
